const e=JSON.parse('{"key":"v-530e2bec","path":"/imports/batch-inserts.html","title":"Batch inserts","lang":"en-US","frontmatter":{"pageClass":"no-toc"},"headers":[{"level":2,"title":"Batch upserts","slug":"batch-upserts","link":"#batch-upserts","children":[]}],"git":{"createdTime":1704429178000,"updatedTime":1704429178000,"contributors":[{"name":"Moments","email":"554676262@qq.com","commits":1}]},"readingTime":{"minutes":0.86,"words":257},"filePathRelative":"imports/batch-inserts.md","localizedDate":"January 5, 2024","excerpt":"<h1> Batch inserts</h1>\\n<p>Importing a large file to Eloquent models, might quickly become a bottleneck as every row results into an insert query.</p>\\n<p>With the <code>WithBatchInserts</code> concern you can limit the amount of queries done by specifying a batch size. This batch size will determine how many models will be inserted into the database in one time. This will drastically reduce the import duration.</p>"}');export{e as data};
